  return (
    <div className="contato">
      <h2>Contato</h2>
      <p>E-mail: lemacramerose@gmail.com</p>
      <p>Telefone: (21) 99372-5678</p>
      <p>Endereço:Estrada B 130, Serra Grande - Niterói - RJ</p>
      <p className='frame' ><iframe src="https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d892.5130991529277!2d-43.01067751927286!3d-22.925801671683622!3m2!1i1024!2i768!4f13.1!5e0!3m2!1spt-BR!2sbr!4v1742701702046!5m2!1spt-BR!2sbr" width="700" height="250" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe></p>
    </div>
  );
}

